	"empreg/view/View1.view.xml":'<mvc:View controllerName="empreg.controller.View1"\n    xmlns:mvc="sap.ui.core.mvc" displayBlock="true"\n    xmlns="sap.m"><Page\n        id="page"\n        title="{i18n>title}"><content><FlexBox\n                class="tileContainer"\n                justifyContent="Center"\n                alignItems="Start"\n                wrap="Wrap"><GenericTile\n                    class="center sapUiTinyMarginBegin sapUiMediumMarginTop tileLayout myCustomTile"\n                    press=".onToPage5"\n                    type="navigation"\n                    frameType="TwoByHalf"><TileContent><content><VBox class="centeredHeader"><Title\n                                    text="All Employees"\n                                    level="H2"\n                                    class="centeredHeaderText"/><Text text="" /></VBox></content></TileContent></GenericTile><GenericTile\n                    class="center sapUiTinyMarginBegin sapUiMediumMarginTop tileLayout myCustomTile"\n                    press=".onToPage2"\n                    type="navigation"\n                    frameType="TwoByHalf"><TileContent><content><VBox class="centeredHeader"><Title\n                                    text="Extension Team"\n                                    level="H2"\n                                    class="centeredHeaderText"/><Text text="" /></VBox></content></TileContent></GenericTile><GenericTile\n                    class="center sapUiTinyMarginBegin sapUiMediumMarginTop tileLayout myCustomTile"\n                    press=".onToPage3"\n                    frameType="TwoByHalf"><TileContent><content><VBox class="centeredHeader"><Title\n                                    text="Integration Team"\n                                    level="H2"\n                                    class="centeredHeaderText"/><Text text="" /></VBox></content></TileContent></GenericTile><GenericTile\n                    class="center sapUiTinyMarginBegin sapUiMediumMarginTop tileLayout myCustomTile"\n                    press=".onToPage4"\n                    frameType="TwoByHalf"><TileContent><content><VBox class="centeredHeader"><Title\n                                    text="Data Analytics Team"\n                                    level="H2"\n                                    class="centeredHeaderText"/><Text text="" /></VBox></content></TileContent></GenericTile></FlexBox></content></Page></mvc:View>\n',
